import React from 'react';
import {  Link } from 'react-router-dom';


class dataPrint extends React.Component {
    render() {
       return (
          <tr>
             <td>{this.props.data.id}</td>
             <td>{this.props.data.name}</td>
             <td>{this.props.data.age}</td>
          </tr>
       );
    }
 }



export default dataPrint;
